import React, { useState } from 'react';
import io from 'socket.io-client';

function Menu({ agents, onDragStart }) {
  return (
    <div className="w-64 bg-[#1a1a1a] p-4 text-white">
      <h2 className="text-xl mb-4 font-roboto">Agentes</h2>
      {agents.map((agent, index) => (
        <div
          key={index}
          draggable
          onDragStart={(e) => onDragStart(e, agent)}
          className="bg-[#2a2a2a] p-3 mb-2 rounded cursor-move hover:bg-[#3a3a3a]"
        >
          {agent.name}
        </div>
      ))}
    </div>
  );
}

function MainArea({ agentOrder, setAgentOrder, handleRemoveAgent, markdownContent, setPrompt, generateContent }) {
  const handleDrop = (e) => {
    e.preventDefault();
    const agent = JSON.parse(e.dataTransfer.getData("agent"));
    if (!agentOrder.find((a) => a.id === agent.id)) {
      setAgentOrder([...agentOrder, agent]);
    }
  };

  const handleDragOver = (e) => {
    e.preventDefault();
  };

  return (
    <div className="flex-1 p-4 bg-[#f5f5f5]">
      <div
        className="bg-[#2a2a2a] p-4 rounded mb-4 text-white min-h-[200px]"
        onDrop={handleDrop}
        onDragOver={handleDragOver}
      >
        <h3 className="text-lg mb-2">Área de Processamento</h3>
        <div className="flex flex-wrap gap-2">
          {agentOrder.map((agent, index) => (
            <div
              key={agent.id}
              className="bg-[#3a3a3a] p-2 rounded flex items-center"
            >
              <span>
                {index + 1}. {agent.name}
              </span>
              <button
                onClick={() => handleRemoveAgent(agent.id)}
                className="ml-2 text-red-500 hover:text-red-700"
              >
                ×
              </button>
            </div>
          ))}
        </div>
      </div>
      <div className="bg-white p-4 rounded shadow-lg">
        <h3 className="text-lg mb-2 text-gray-800">Markdown Preview</h3>
        <div className="bg-gray-100 p-4 rounded min-h-[300px] font-mono">
          {markdownContent || "O conteúdo markdown será exibido aqui..."}
        </div>
      </div>
      <input type="text" placeholder="Digite o prompt" onChange={(e) => setPrompt(e.target.value)} />
      <button onClick={generateContent}>Gerar Conteúdo</button>
    </div>
  );
}

function Details({ selectedAgent }) {
  if (!selectedAgent) return <div className="w-64 bg-[#1a1a1a] p-4 text-white"><h2 className="text-xl mb-4 font-roboto">Detalhes</h2><p>Nenhum agente selecionado</p></div>;

  return (
    <div className="w-64 bg-[#1a1a1a] p-4 text-white">
      <h2 className="text-xl mb-4 font-roboto">Detalhes</h2>
      <div className="bg-[#2a2a2a] p-3 rounded mb-4">
        <h3 className="text-sm font-bold mb-2">Agente</h3>
        <div className="space-y-2">
          <p className="text-sm">
            <span className="text-gray-400">Role:</span>{" "}
            {selectedAgent.role}
          </p>
          <p className="text-sm">
            <span className="text-gray-400">Goal:</span>{" "}
            {selectedAgent.goal}
          </p>
          <p className="text-sm">
            <span className="text-gray-400">Backstory:</span>{" "}
            {selectedAgent.backstory}
          </p>
        </div>
      </div>
    </div>
  );
}

function App() {
  const [agents] = useState([
    { id: 1, name: "Gerente" },
    { id: 2, name: "Pesquisador" },
    { id: 3, name: "Escritor" },
    { id: 4, name: "Publicador" }
  ]);
  const [agentOrder, setAgentOrder] = useState([]);
  const [markdownContent, setMarkdownContent] = useState("");
  const [prompt, setPrompt] = useState("");

  const handleDragStart = (e, agent) => {
    e.dataTransfer.setData("agent", JSON.stringify(agent));
  };

  const handleRemoveAgent = (agentId) => {
    setAgentOrder(agentOrder.filter((agent) => agent.id !== agentId));
  };

  const generateContent = () => {
    const socket = io('http://localhost:6000');
    socket.emit('start_tasks', { tema: prompt });
    socket.on('task_results', (data) => {
      setMarkdownContent(data);
    });
  };

  return (
    <div className="flex h-screen">
      <Menu agents={agents} onDragStart={handleDragStart} />
      <MainArea agentOrder={agentOrder} setAgentOrder={setAgentOrder} handleRemoveAgent={handleRemoveAgent} markdownContent={markdownContent} setPrompt={setPrompt} generateContent={generateContent} />
      <Details selectedAgent={null} />
    </div>
  );
}

export default App;
